import React from 'react';
import Home from './components/Home';
import Header from './components/Header';

function App() {
  return (
    <div className="App">
      <Router>
          <Switch>
              <Route path="/" exact component={Home} />
              <Route path="/quiz" component={QuizContainer} />
          </Switch>
        </Router>
    </div>
  );
}

export default App;
